var title_f41_60_42956="MDMA-ecstasy-intoxication - Rapid overview";
var content_f41_60_42956=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F57745&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F57745&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    MDMA (ecstasy) intoxication in adolescents and adults: Rapid overview",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        <span style=\"color: #ff0000;\">",
"         To obtain emergent consultation with a medical toxicologist, call the United States Poison Control Network at 1-800-222-1222, or access the World Health Organization's list of international poison centers (",
"        </span>",
"        <a href=\"file://www.who.int/gho/phe/chemical_safety/poisons_centres/en/index.html\" target=\"_blank\">",
"         www.who.int/gho/phe/chemical_safety/poisons_centres/en/index.html",
"        </a>",
"        <span style=\"color: #ff0000;\">",
"         ).",
"        </span>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Clinical features",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        MDMA is a serotonergic amphetamine that generally causes feelings of euphoria, empathy, excitement, and wellbeing",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Patients with MDMA toxicity may exhibit CNS agitation, hypertension, tachycardia, and hyperthermia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        MDMA intoxication can cause severe hyponatremia, seizures, and obtundation. Serotonin syndrome can occur.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Laboratory evaluation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Obtain the following:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Fingerstick glucose, electrocardiogram, acetaminophen and aspirin levels, and pregnancy test (when appropriate)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Basic chemistries, to assess serum sodium and creatinine",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Creatinine kinase, for evidence of rhabdomyolysis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Liver function testing and coagulation profiles in severely ill patients",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Treatment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Secure airway, breathing, and circulation: standard rapid sequence medications may be used; treat severe hypertension initially with benzodiazepines (eg, lorazepam, 1 to 2 mg IV push, may repeat as needed; or in the absence of IV access midazolam 3 to 5 mg intramuscularly, may repeat as needed)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Give one dose of activated charcoal (1 g/kg; maximum dose 50 g) for ingestions less than one hour if airway protected",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Agitation and/or seizures: give benzodiazepines (eg, lorazepam 1 to 2 mg IV push or midazolam 3 to 5 mg IM; may repeat as needed);",
"        <strong>",
"         DO NOT",
"        </strong>",
"        give butyrophenones (eg, haloperidol);",
"        <strong>",
"         DO NOT",
"        </strong>",
"        give phenytoin",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Chest pain: give oxygen, aspirin and nitroglycerin if chest pain does not respond to benzodiazepines;",
"        <strong>",
"         DO NOT",
"        </strong>",
"        administer beta-blocking agents",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hyperthermia: active external cooling, benzodiazepines;",
"        <strong>",
"         DO NOT",
"        </strong>",
"        give antipyretics",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hyponatremia: fluid restriction if hyponatremia is mild or moderate (above 115 mEq/dL)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hyponatremia with persistent seizure: benzodiazepines (eg, lorazepam 1 to 2 mg IV push or midazolam 3 to 5 mg IM; may repeat as needed); hypertonic saline (3 percent or 513 mEq/L), if serum sodium 115 mEq/dL or less, give 100 mL as IV bolus; if seizures persist, give one or two additional doses of 100 mL, with each dose given over 10 minutes;",
"        <strong>",
"         DO NOT",
"        </strong>",
"        give additional hypertonic or normal saline; monitor serum sodium closely;",
"        <strong>",
"         DO NOT",
"        </strong>",
"        give phenytoin",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     MDMA: 3,4-methylenedioxymethamphetamine.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
