" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Exercise-induced left bundle branch block (LBBB) predicts worse outcomes",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 329px; height: 346px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
